(3, 'Nature Church', 'pic04.jpg', 'published', '2022-09-28 14:48:21', 'Nature Church', 'Nestled inside the city landscape of Las Pi√±as is the charming nook ', '&lt;h4&gt;Nestled inside the city landscape of Las Pi&ntilde;as is the charming nook that is called Nature Church or Parish of Mary Immaculate Church. This quiet spiritual sanctuary is a sprawling area of natural beauty. Inside the church grounds are full of tall and shady trees. In fact, the church is situated in a half-century old mango orchard, and everything was well preserved. None of the trees were cut down during the construction of the church, and most of the materials used in building it were cast off construction materials.&lt;br&gt;The church itself is full of all things inspired by nature. This nipa-hut open-air structure has a high ceiling that is made out of wood, anahaw and other native materials. The ceiling is peppered with hanging dove d&eacute;cors that are actually lighting fixtures made out of Capiz shells, which add to its charm. The church&rsquo;s altar is made out of driftwood and marble&mdash;both natural materials as well. A big statue of Jesus was put in a prominent position near the altar to complete this place of prayer and meditation.&lt;br&gt;Built in 1986, this airy church can comfortably accommodate about 100 people or so in its tree trunk stumps that serve as seats. It is nice to know that the seats were created from fallen tree stumps and logs, which came from star apple trees. These really give a rustic feel to the place, which is why this particular church is a favorite for quaint weddings among locals.&lt;br&gt;Beside the main church, near the entrance, is the San Lorenzo de Manila Chapel, which is a smaller version of the main church. The chapel has a lot of wooden furnishings and d&eacute;cor as well. This is just perfect for more intimate church gatherings.&lt;br&gt;The man behind the amazing architecture of this church is Francisco &ldquo;Bobby&rdquo; Ma&ntilde;osa, who was cited in Asia Week Magazine as one of Asia&rsquo;s visionary architects. He was also the one who designed the Coconut Palace, which actually has a similar style and feel.&lt;/h4&gt;');

